import './Servico.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import '../PageGlobal.css'
import '../../Style/Global.css'
import { useEffect, useState } from 'react'
import Axios from 'axios';


function Servico() {

  //const baseUrl = "http://34.135.105.123:8080"
  const baseUrl = "http://localhost:8080"
  const[APIData, setAPIData]= useState([]);

  useEffect(() => {
    Axios
      .get(`${baseUrl}/servico/ListarServicos`)
      .then((response) => { setAPIData(response.data)}) 
      .catch((err) => {
        console.error("ops! ocorreu um erro" + err);
      });
  }, []);


    return(<>

        <div className='blocoAdicional'>

          <div className='blocoAdicional'>
            <div class="input-group mb-3">
              <span class="input-group-text" id="basic-addon1">Nome</span>
              <input type="text" class="form-control" placeholder="Nome Para Pesquisa" aria-label="Username" aria-describedby="basic-addon1"/>
            </div>
          </div>

        </div>


        <div className="BoxConteudoPagina">
            <div className='conteudoInterno'>
            {APIData.map((data, i)=>{
                                return(<>
                                <div className="Retorno">
                                  <div className="Destaque">
                                    <div className="infoOs">
                                      <span>{data.nome}</span><br/>
                                      
                                  </div>
                                </div>
                                <div className="infoGeral">
                                    <span>({data.valorFront})</span><br/>
                                    <span>Descrição: {data.descricao}</span><br/><br/>
                                    <span>Código: {data.codigo}</span><br/><br/>
                                    <span>Mão de Obra: {data.maoDeObra}</span><br/>
                                </div>
                              </div>
                                </>)
                            })}

        </div>                  
        </div>
    
    
    </>)}

    export default Servico;
